import React from 'react';

export default function FooterColumn({ 
  heading = 'column heading', 
  links=[
    {
      type: "Links",
      title: "Home",
      path: "/home"
    },
    {
      type: "Links",
      title: "About",
      path: "/about",
    },
  ],
}) {
  return (
    <div>
      <h1 className="heading">{heading}</h1>
      <ul>

      </ul>
    </div>
  );
}
